INSERT INTO `airag_flow` VALUES ('1909856345692065793', 'jeecg', '2025-04-09 14:30:11', 'admin', '2025-05-28 16:39:13', 'A04', NULL, 'jeecg', 'JimuReport AI引擎', '', '', 'THEN(\n    start.tag(\'start-node\'),\n    SWITCH(switch.tag(\'173365501230346240\')).to(\n        THEN(\n            llm.tag(\'172956395755208704\'),\n            end.tag(\'172957153284259840\')\n        ).tag(\"172956395755208704\"),\n        THEN(\n            llm.tag(\'173365800833675264\'),\n            end.tag(\'173366253646540800\')\n        ).tag(\"173365800833675264\"),\n        end.tag(\'173366439085109248\'),\n        THEN(\n            llm.tag(\'175149164433014784\'),\n            end.tag(\'175153953988444160\')\n        ).tag(\"175149164433014784\"),\n        THEN(\n            llm.tag(\'175505963485245440\'),\n            end.tag(\'175506006644633600\')\n        ).tag(\"175505963485245440\"),\n        THEN(\n            llm.tag(\'175807569594040320\'),\n            end.tag(\'175808663015538688\')\n        ).tag(\"175807569594040320\")\n    ).tag(\'173365501230346240\')\n).tag(\"start-node\")', '{\"nodes\":[{\"id\":\"start-node\",\"type\":\"start\",\"x\":262,\"y\":458,\"properties\":{\"text\":\"开始\",\"remarks\":\"\",\"options\":{},\"inputParams\":[{\"field\":\"content\",\"name\":\"用户问题\",\"type\":\"string\",\"required\":true},{\"field\":\"history\",\"name\":\"历史记录\",\"type\":\"string[]\",\"required\":false},{\"field\":\"ddl\",\"name\":\"表结构\",\"type\":\"string\",\"required\":true},{\"field\":\"dbtype\",\"name\":\"数据库类型\",\"type\":\"string\",\"required\":true},{\"field\":\"bizType\",\"name\":\"业务类型\",\"type\":\"string\",\"required\":true}],\"outputParams\":[],\"height\":92,\"width\":332}},{\"id\":\"172956395755208704\",\"type\":\"llm\",\"x\":1166,\"y\":160,\"properties\":{\"text\":\"生成sql\",\"options\":{\"model\":{\"modeId\":\"1890232564262739969\",\"params\":{\"model\":\"OpenAI\",\"temperature\":0.7}},\"history\":3,\"messages\":[{\"role\":\"system\",\"content\":\"# 角色：SQL生成助手\\n你是一个专业的SQL语句生成工具，能够根据用户提供的描述和表结构自动生成高效的SQL查询语句。\\n\\n## 目标：\\n- 根据用户的描述生成准确的SQL查询语句。\\n\\n## 技能：\\n1. 理解用户提供的需求和表结构。\\n2. 自动构建符合SQL语法的查询语句。\\n3. 优化生成的SQL以提高执行效率。\\n\\n## 工作流：\\n1. 接收用户描述和表结构信息。\\n2. 分析用户需求，确定所需的SQL操作类型（如查询、插入、更新、删除）。\\n3. 根据分析结果生成相应的SQL语句。\\n\\n## 输出格式：\\n- 生成的SQL语句应为标准格式，如：SELECT * FROM table_name ;\\n- 将输出的SQL语句格式化\\n- 只输出sql语句，不要额外解释，不要md语法，不要换行符，不要有sql注释。\\n\\n## 限制：\\n\\n- 除非明确说明，否则不要生成查询条件\\n- 确保生成的SQL语句符合数据库的语法要求，确保sql能直接执行。\\n- 确保字段和表能正确对应。\"},{\"role\":\"user\",\"content\":\"表结构：\\n{{ddl}}\\n---------\\n数据库类型：\\n{{dbtype}}\\n----------\\n需求：\\n{{question}}\"}]},\"inputParams\":[{\"field\":\"content\",\"name\":\"question\",\"nodeId\":\"start-node\"},{\"field\":\"ddl\",\"name\":\"ddl\",\"nodeId\":\"start-node\"},{\"field\":\"dbtype\",\"name\":\"dbtype\",\"nodeId\":\"start-node\"}],\"outputParams\":[{\"field\":\"text\",\"name\":\"回复内容\",\"type\":\"string\"}],\"height\":180,\"width\":332}},{\"id\":\"172957153284259840\",\"type\":\"end\",\"x\":1643,\"y\":129,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":false,\"outputContent\":\"\"},\"inputParams\":[],\"outputParams\":[{\"field\":\"text\",\"name\":\"sql\",\"nodeId\":\"172956395755208704\"}],\"height\":114,\"width\":332}},{\"id\":\"173365501230346240\",\"type\":\"switch\",\"x\":688,\"y\":536,\"properties\":{\"text\":\"条件分支\",\"options\":{\"if\":[{\"logic\":\"AND\",\"conditions\":[{\"nodeId\":\"start-node\",\"field\":\"bizType\",\"operator\":\"EQUALS\",\"value\":\"genSql\"}],\"next\":\"172956395755208704\"},{\"logic\":\"AND\",\"conditions\":[{\"nodeId\":\"start-node\",\"field\":\"bizType\",\"operator\":\"EQUALS\",\"value\":\"genJsonRows\"}],\"next\":\"173365800833675264\"},{\"logic\":\"AND\",\"conditions\":[{\"nodeId\":\"start-node\",\"field\":\"bizType\",\"operator\":\"EQUALS\",\"value\":\"chooseTables\"}],\"next\":\"175149164433014784\"},{\"logic\":\"AND\",\"conditions\":[{\"nodeId\":\"start-node\",\"field\":\"bizType\",\"operator\":\"EQUALS\",\"value\":\"genChart\"}],\"next\":\"175505963485245440\"},{\"logic\":\"AND\",\"conditions\":[{\"nodeId\":\"start-node\",\"field\":\"bizType\",\"operator\":\"EQUALS\",\"value\":\"intentCheck\"}],\"next\":\"175807569594040320\"}],\"else\":{\"next\":\"173366439085109248\"}},\"inputParams\":[],\"outputParams\":[{\"field\":\"index\",\"name\":\"分支索引\",\"type\":\"number\"}],\"height\":222,\"width\":332}},{\"id\":\"173365800833675264\",\"type\":\"llm\",\"x\":1167,\"y\":368,\"properties\":{\"text\":\"生成rows\",\"options\":{\"model\":{\"modeId\":\"1890232564262739969\",\"params\":{\"model\":\"OpenAI\",\"temperature\":0.7}},\"history\":3,\"messages\":[{\"role\":\"system\",\"content\":\"根据以下数据以及用户需求生成符合要求的表格数据结构。\\n\\n\\n\\n\\n## 工作流程：\\n\\n\\n\\n\\n1. 根据用户需求选择一个合适的数据集\\n2. 根据数据集和需求，生成表格数据。\\n2. 最终输出json\\n\\n\\n\\n\\n## 数据集格式说明：\\n```\\n{\\n \\\"code\\\": \\\"a\\\",\\n \\\"title\\\": \\\"a\\\",\\n \\\"isList\\\": \\\"1\\\",\\n \\\"children\\\": [\\n  {\\n   \\\"title\\\": \\\"total_sales\\\",\\n   \\\"fieldText\\\": \\\"总销量\\\"\\n  },\\n  {\\n   \\\"title\\\": \\\"total_returns\\\",\\n   \\\"fieldText\\\": \\\"总退货数量\\\"\\n  }\\n ]\\n}\\n```\\n* code：数据集变量名\\n* isList：为”1”表示集合，“0”表示对象\\n* children：为字段列表，包含title（字段名）和fieldText（展示名）\\n⸻\\n## 表格数据结构说明：\\n```\\n{\\n \\\"0\\\": { \\\"cells\\\": {} },\\n \\\"1\\\": { \\\"cells\\\": {\\n   \\\"1\\\": { \\\"text\\\": \\\"#{a.total_sales}\\\" },\\n   \\\"2\\\": { \\\"text\\\": \\\"#{a.name}\\\" }\\n }},\\n \\\"len\\\": 200\\n}\\n```\\n* 行号作为键\\n* 每行下有 cells 对象，key 是列号\\n* 每行以序号作为键\\n* 每列下包含 text 为占位符，${} 用于对象，#{} 用于集合\\n* 可包含 style 等附加样式信息\\n⸻\\n\\n\\n\\n\\n## 填充规则：\\n1. 若 isList = 1（集合）：\\n * 第N行（如 \\\"0\\\"）为字段标题：使用 children.fieldText 填充\\n * 第N+1行（如 \\\"1\\\"）为字段占位符：使用 `#{code.title}` 填充\\n * 所有字段占位符占用一行，所有标题占用一行\\n2. 若 isList = 0（对象）：\\n * 每字段占两列，低N列填字段标题，N+1列填占位符 `${code.title}`\\n * 共两组：第一组在第n列，第二组在第N+2列\\n\\n\\n\\n\\n⸻\\n\\n\\n\\n\\n## 输出格式\\n* 直接返回JSON数据，不要解释，不要md语法，不要换行符，不要有注释。\\n* 确保输出的JSON格式正确，数据中不能包含注释和省略。\\n\\n\\n\\n\\n\\n\\n\\n\\n## 特别注意\\n- 字段的占位必须是`#{}`或`${}`，不能缺失大括号。\\n- 用户描述的序号需要减一才是下标\\n- 确保输出的json格式正确。\\n- 只需要生成一套表格数据。\"},{\"role\":\"user\",\"content\":\"用户数据集：\\n{{ddl}}\\n用户需求：\\n{{question}}\"}]},\"inputParams\":[{\"field\":\"content\",\"name\":\"question\",\"nodeId\":\"start-node\"},{\"field\":\"ddl\",\"name\":\"ddl\",\"nodeId\":\"start-node\"}],\"outputParams\":[{\"field\":\"text\",\"name\":\"回复内容\",\"type\":\"string\"}],\"height\":180,\"width\":332}},{\"id\":\"173366253646540800\",\"type\":\"end\",\"x\":1643,\"y\":336,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":false,\"outputContent\":\"\"},\"inputParams\":[],\"outputParams\":[{\"field\":\"text\",\"name\":\"rows\",\"nodeId\":\"173365800833675264\"}],\"height\":114,\"width\":332}},{\"id\":\"173366439085109248\",\"type\":\"end\",\"x\":1158,\"y\":1209,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":true,\"outputContent\":\"error:选择正确的业务类型\"},\"inputParams\":[],\"outputParams\":[],\"height\":114,\"width\":332}},{\"id\":\"175149164433014784\",\"type\":\"llm\",\"x\":1164,\"y\":598,\"properties\":{\"text\":\"选择表\",\"options\":{\"model\":{\"modeId\":\"1890232564262739969\",\"params\":{\"model\":\"OpenAI\",\"temperature\":0.7}},\"history\":2,\"messages\":[{\"role\":\"system\",\"content\":\"## 任务\\n根据用户需求，从下方数据库表列表中选择所有关联的表名称。\\n\\n\\n## 数据库表列表（格式：表名 | 注释）\\n{{ddl}}\\n\\n## 输出规则\\n1. 严格按JSON数组格式输出，例如：[\\\"order\\\"]。\\n2. 仅包含表名称，无需注释。\\n3. **禁止添加列表外的表**。\\n4. 表的选择范围可以适当大一些。\\n4. 无业务相关性时输出空数组：[]\\n\\n\\n请回复纯JSON，不要包含其他内容。\"},{\"role\":\"user\",\"content\":\"用户需求：{{question}}\"}]},\"inputParams\":[{\"field\":\"ddl\",\"name\":\"ddl\",\"nodeId\":\"start-node\"},{\"field\":\"content\",\"name\":\"question\",\"nodeId\":\"start-node\"}],\"outputParams\":[{\"field\":\"text\",\"name\":\"回复内容\",\"type\":\"string\"}],\"height\":180,\"width\":332}},{\"id\":\"175153953988444160\",\"type\":\"end\",\"x\":1643,\"y\":564,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":false,\"outputContent\":\"\"},\"inputParams\":[],\"outputParams\":[{\"field\":\"text\",\"name\":\"tables\",\"nodeId\":\"175149164433014784\"}],\"height\":114,\"width\":332}},{\"id\":\"175505963485245440\",\"type\":\"llm\",\"x\":1166,\"y\":802,\"properties\":{\"text\":\"生成图表\",\"options\":{\"model\":{\"modeId\":\"1890232564262739969\",\"params\":{\"model\":\"OpenAI\",\"temperature\":0.7}},\"history\":3,\"messages\":[{\"role\":\"system\",\"content\":\"根据以下数据以及用户需求生成符合格式要求的图表数据。\\n\\n\\n## 工作流程：\\n\\n\\n1. 根据用户需求选择一个合适的数据集\\n2. 根据数据集和需求，从图表列表中选择一个合适的图标类型。\\n3. 组装最终输出的json\\n\\n\\n⸻\\n## 可选的图表如下（标识|描述）：\\n\\n\\n- 1维图表\\n  - bar.simple|普通柱形图\\n  - bar.background|带背景柱形图\\n  - bar.horizontal|横向柱形图\\n  - line.simple|普通折线图\\n  - line.area|面积堆积折线图\\n  - line.smooth|平滑曲线折线图\\n  - line.step|阶梯折线图\\n  - pie.simple|普通饼图\\n  - pie.doughnut|环状饼图\\n  - pie.rose|南丁格尔玫瑰饼图\\n  - scatter.simple|普通散点图\\n  - funnel.simple|普通漏斗图\\n  - funnel.pyramid|金字塔漏斗图\\n  - pictorial.spirits|普通象形图\\n  - map.scatter|点地图\\n  - gauge.simple|360°仪表盘\\n  - gauge.simple180|180°仪表盘\\n- 2维\\n  - bar.multi|多数据对比柱形图\\n  - bar.negative|正负条形图\\n  - bar.stack|堆叠柱形图\\n  - bar.stack.horizontal|堆叠条形图\\n  - bar.multi.horizontal|多数据条形柱状图\\n  - line.multi|多数据对比折线图\\n  - mixed.linebar|普通折柱图\\n  - scatter.bubble|气泡散点图\\n  - radar.basic|普通雷达图\\n  - radar.custom|圆形雷达图\\n⸻\\n## 数据集格式说明：\\n```\\n{\\n \\\"dbId\\\": \\\"1069915169263800320\\\",\\n \\\"code\\\": \\\"a\\\",\\n \\\"title\\\": \\\"a\\\",\\n \\\"isList\\\": \\\"1\\\",\\n \\\"type\\\": \\\"0\\\",\\n \\\"children\\\": [\\n  {\\n   \\\"title\\\": \\\"total_sales\\\",\\n   \\\"fieldText\\\": \\\"total_sales\\\"\\n  },\\n  {\\n   \\\"title\\\": \\\"total_returns\\\",\\n   \\\"fieldText\\\": \\\"total_returns\\\"\\n  }\\n ]\\n}\\n```\\n* code：数据集变量名\\n* isList：为”1”表示集合，“0”表示对象\\n* children：为字段列表，包含title（字段名）和fieldText（展示名）\\n* type：0|sql,1|api,2|code,3|json\\n⸻\\n## 输出json格式\\n{\\n  \\\"dataType\\\": \\\"sql\\\",\\n  \\\"apiStatus\\\": \\\"0\\\",\\n  \\\"apiUrl\\\": \\\"\\\",\\n  \\\"dataId\\\": \\\"1069898455939633152\\\",\\n  \\\"axisX\\\": \\\"supplier_name\\\",\\n  \\\"axisY\\\": \\\"total_returns\\\",\\n  \\\"series\\\": \\\"material_name\\\",\\n  \\\"yText\\\": \\\"total_returns\\\",\\n  \\\"xText\\\": \\\"supplier_name\\\",\\n  \\\"dbCode\\\": \\\"a\\\",\\n  \\\"isCustomPropName\\\": false,\\n  \\\"chartType\\\": \\\"line.multi\\\",\\n  \\\"id\\\": \\\"0aGl4PUfbIfy8BMF\\\",\\n  \\\"run\\\": 1,\\n  \\\"title\\\": \\\"\\\",\\n}\\n* dataType：与数据集type对应(0|sql,1|api,2|code,3|json)\\n* dataId：对应数据集dbId\\n* dbCode：对应数据集的code\\n* axisX：分类属性，从数据集字段中取值（fieldText)\\n* axisY：值属性，从数据集字段中取值（fieldText)\\n* series: 系列，从数据集字段中取值（fieldText）\\n* xText：分类属性显示，从数据集字段中取值（title)\\n* yText：值属性显示，从数据集字段中取值（title)\\n* chartType：图表的标识\\n* title：为这个图表起一个标题\\n* isCustomPropName: 如果是api数据集,该值为true\\n* apiStatus: 如果是api数据集则等于\\\"1\\\"，否则\\\"0\\\"\\n\\n\\n## 输出格式\\n* 直接返回JSON数据，不要解释，不要md语法，不要换行符，不要有注释。\\n* 确保输出的json格式正确完整。\"},{\"role\":\"user\",\"content\":\"## 用户数据集：\\n{{ddl}}\\n## 用户需求：\\n{{question}}\"}]},\"inputParams\":[{\"field\":\"ddl\",\"name\":\"ddl\",\"nodeId\":\"start-node\"},{\"field\":\"content\",\"name\":\"question\",\"nodeId\":\"start-node\"}],\"outputParams\":[{\"field\":\"text\",\"name\":\"回复内容\",\"type\":\"string\"}],\"height\":180,\"width\":332}},{\"id\":\"175506006644633600\",\"type\":\"end\",\"x\":1643,\"y\":769,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":false,\"outputContent\":\"\"},\"inputParams\":[],\"outputParams\":[{\"field\":\"text\",\"name\":\"chart\",\"nodeId\":\"175505963485245440\"}],\"height\":114,\"width\":332}},{\"id\":\"175807569594040320\",\"type\":\"llm\",\"x\":1166,\"y\":1018,\"properties\":{\"text\":\"意图识别\",\"options\":{\"model\":{\"modeId\":\"1890232564262739969\",\"params\":{\"model\":\"OpenAI\",\"temperature\":0.7}},\"history\":3,\"messages\":[{\"role\":\"system\",\"content\":\"请根据用户需求与数据集设计，综合判断应执行的工作流步骤，并为每个步骤生成简洁明确的需求描述，同时选择最合适的数据集。\\n---\\n## 可选步骤（格式：标识 | 功能说明）\\n- `genJsonRows` | 生成报表（可选）\\n- `genChart` | 生成图表（可选）\\n> **注意：** 至少选择一个步骤，亦可同时选择两者；图表的权重较低。\\n---\\n## 数据集格式\\n```json\\n{\\n \\\"dbId\\\": \\\"1069915169263800320\\\",\\n \\\"code\\\": \\\"a\\\",\\n \\\"title\\\": \\\"a\\\",\\n \\\"isList\\\": \\\"1\\\",\\n \\\"type\\\": \\\"0\\\",\\n \\\"children\\\": [\\n  {\\n   \\\"title\\\": \\\"total_sales\\\",\\n   \\\"fieldText\\\": \\\"total_sales\\\"\\n  },\\n  {\\n   \\\"title\\\": \\\"total_returns\\\",\\n   \\\"fieldText\\\": \\\"total_returns\\\"\\n  }\\n ]\\n}\\n* code：数据集变量名\\n* isList：为”1”表示集合，“0”表示对象\\n* children：为字段列表，包含title（展示名）和fieldText（字段名）\\n* type：0|sql,1|api,2|code,3|json\\n⸻\\n## 输出格式\\n```\\n步骤标识1|需求描述1|数据集code,步骤标识2|需求描述2|数据集code\\n```\\n* 各步骤之间用英文逗号,分隔\\n* 不得添加额外说明，不要md语法，不要换行符，不要有注释。\"},{\"role\":\"user\",\"content\":\"## 用户数据集：\\n{{ddl}}\\n## 用户需求：\\n{{question}}\"}]},\"inputParams\":[{\"field\":\"content\",\"name\":\"question\",\"nodeId\":\"start-node\"},{\"field\":\"ddl\",\"name\":\"ddl\",\"nodeId\":\"start-node\"}],\"outputParams\":[{\"field\":\"text\",\"name\":\"回复内容\",\"type\":\"string\"}],\"height\":180,\"width\":332}},{\"id\":\"175808663015538688\",\"type\":\"end\",\"x\":1643,\"y\":985,\"properties\":{\"text\":\"结束\",\"options\":{\"outputText\":false,\"outputContent\":\"\"},\"inputParams\":[],\"outputParams\":[{\"field\":\"text\",\"name\":\"intent\",\"nodeId\":\"175807569594040320\"}],\"height\":114,\"width\":332}}],\"edges\":[{\"id\":\"172957153288454144\",\"type\":\"base-edge\",\"sourceNodeId\":\"172956395755208704\",\"targetNodeId\":\"172957153284259840\",\"sourceAnchorId\":\"172956395755208704_output\",\"targetAnchorId\":\"172957153284259840_input\",\"pointsList\":[{\"x\":1332,\"y\":101},{\"x\":1432,\"y\":101},{\"x\":1377,\"y\":103},{\"x\":1477,\"y\":103}]},{\"id\":\"173365501234540544\",\"type\":\"base-edge\",\"sourceNodeId\":\"start-node\",\"targetNodeId\":\"173365501230346240\",\"sourceAnchorId\":\"start-node_output\",\"targetAnchorId\":\"173365501230346240_input\",\"pointsList\":[{\"x\":428,\"y\":443},{\"x\":528,\"y\":443},{\"x\":422,\"y\":456},{\"x\":522,\"y\":456}]},{\"id\":\"173366253650735104\",\"ty